-- Copiando estrutura para trigger sms.Tgr_entrada_item_Insert
DROP TRIGGER IF EXISTS `Tgr_entrada_item_Insert`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `Tgr_entrada_item_Insert` AFTER INSERT ON `entrada_item` FOR EACH ROW BEGIN
UPDATE estoque SET ENTRADA = ENTRADA + New.QUANTIDADE,
QTATUAL = QTATUAL + New.QUANTIDADE
WHERE CODPRODUTO = New.CODPRODUTO
and ANO = New.ANO
AND MES = New.MES; 
END//
DELIMITER ;
